import React from 'react'

const Employee = ({ emp }) => {
    return (
        <tr key={emp.id}>
            <td className='text-left px-6 py-4 whitespace-nowrap'><div className='text-sm text-gray-500'>{emp.id}</div></td>
            <td className='text-center px-6 py-4 whitespace-nowrap'><div className='text-sm text-gray-500'>{emp.firstName}</div></td>
            <td className='text-center px-6 py-4 whitespace-nowrap'><div className='text-sm text-gray-500'>{emp.lastName}</div></td>
            <td className='text-right px-6 py-4 whitespace-nowrap'><div className='text-sm text-gray-500'>{emp.emailId}</div></td>
            <td className='text-right px-6 py-4 whitespace-nowrap'><div className='text-sm text-gray-500'><a></a></div></td>
        </tr>

    )
}

export default Employee
